import ProfileCard from "./ProfileCard";

function App() {
  return (
    <div >
        <div>
            Personal Digital Assistant
        </div>
      <ProfileCard title="Alexxa" handle="@Alexa"/>
       <ProfileCard title="Cortana" handle="@Cort"/>
        <ProfileCard title="Siri" handle="@Siri"/>
    </div>
  );
}

export default App;
